import { actionTypes } from '../actionTypes'

export function onClickAdd(value) {
  return {
    type: actionTypes.CLICK_ADD,
    value
  }
}

export function onClickSubstract(index) {
  return {
    type: actionTypes.CLICK_SUBSTRACT,
    index
  }
}

export function onClickAddAsync(index) {
  return {
    type: actionTypes.CLICK_ADD_ASYNC,
    index
  }
}

export function onClickSubstractAsync(value, index) {
  return {
    type: actionTypes.CLICK_SUBSTRACT_ASYNC,
    value,
    index
  }
}
